import React, { useContext } from 'react';
import { ProductsContext } from '../../context/products.context';

function Shop() {
    const { products } = useContext(ProductsContext)
    return (
        <div>
            {
                products.map(({id, name}) => {
                    return (
                        <div key={id}>
                            <h2>{name}</h2>
                        </div>
                    );
                })
            }
        </div>
    )
}

export default Shop;
